  `domain` varchar(25) DEFAULT NULL,
  `domain_category` varchar(25) DEFAULT NULL,
  `value` float DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `statecode` (`statecode`,`cropname`)
) ENGINE=MyISAM AUTO_INCREMENT=95938 DEFAULT CHARSET=latin1;
