#create the historic and modern management table
DROP TABLE IF EXISTS test_marke.planner_cropland_historic_and_modern_management;
CREATE TABLE test_marke.planner_cropland_historic_and_modern_management ( 
	id INTEGER AUTO_INCREMENT PRIMARY KEY, 
	cps_id INTEGER, 
	mlra VARCHAR( 5 ), 
	historic_management_name VARCHAR( 150 ), 
	modern_management_name VARCHAR( 150 ) );

INSERT INTO test_marke.planner_cropland_historic_and_modern_management ( cps_id, mlra, historic_management_name, modern_management_name ) SELECT DISTINCT pcl.id, mcfc.mlra42, IF( pcl.irrigated = 'Y', 'Irrigation (Pre 1980s)', 'Upland Non-Irrigated (Pre 1980s)' ), IF( pcl.irrigated = 'Y', phml.irrigated_system, phml.non_irrigated_system  ) FROM test_marke.planner_cropland_cps_list pcl, test_marke.mlra42_list mcfc, test_marke.planner_cropland_historic_management_lookup phml WHERE pcl.practice = 'Intensive Tillage to No Tillage or Strip Tillage' AND mcfc.lrr2 = phml.lrr ORDER BY mcfc.mlra42, pcl.id;
