CREATE TABLE test_marke.planner_cropland_burning (
	id INTEGER AUTO_INCREMENT PRIMARY KEY, 
	id_planner_cropland_crops INTEGER, 
	month SMALLINT,
	day_of_month SMALLINT,
	day_of_year SMALLINT, 
	burn_type VARCHAR( 50 ), 
