	'no burning' as 'burn_type' 
FROM 
	test_marke.crop_planting_harvest_dates cphd 
	JOIN test_marke.planner_cropland_crops pc ON cphd.statecode = pc.statecode AND cphd.cdl_name = pc.cropname1
